import { configureStore } from '@reduxjs/toolkit'
import testState from "./../store/testSlice.js"
import testState2 from "./../store/testSlice2.js"

export default configureStore({
  reducer: {
    testState: testState.reducer,
    testState2: testState.reducer
  }
})
